   const dateTaken = photo.datetaken.split(" ")

    return (
        <li onClick={showPhotoInfo(photo.id)}>
            <h1>{photo.title}</h1>
            <img src={photo.url_l} alt={photo.title}></img>
            <div id="Date">
                <h2>Date:{dateTaken[0]}</h2>
                <h2>Time:{dateTaken[1]}</h2>
            </div>
        </li>
    )

}

export default Photo

